import React from 'react';
import logo from '../img/logo.svg'

const SidebarLeft = () => {
    return (
        <div className='d-flex'>
           <div className=''>
            <img src={logo} alt='logi'></img>
           </div>
        </div>
    );
}

export default SidebarLeft;
